Российский футбол покидают специалисты

📍Главный тренер московского футбольного клуба "Локомотив" немец Маркус Гисдоль освобожден от должности;

📍Ранее московское «Динамо» и украинский помощник главного тренера Андрей Воронин достигли соглашения о расторжении контракта по соглашению сторон.

❗️Минцифры РФ подготовило перечень первоочередных мер для стабилизации и развития IT-отрасли в условиях санкций, рассказал источник РВНП.

Предлагается:
1) распространить действующие налоговые льготы также на IT-компании, получающие доходы от размещения рекламы или оказания допуслуг в своих приложениях и онлайн-сервисах, а также от реализации, установки, тестирования и сопровождения партнерских отечественных IT-продуктов;
2) освободить на следующие 3 года всех сотрудников ИТ-компаний от уплаты НДФЛ, а сами компании от уплаты налога на прибыль, а также освободить эти компании от проверок;
3) предоставить всем сотрудникам IT-компаний льготную ипотеку со ставкой 5% на время работы;
4) предоставить отсрочку от призыва на военную службу для сотрудников IT-компаний на время их работы в этих компаниях;
5) ввести процедуры упрощенного получения разрешения на работу и вида на жительство для иностранных граждан, привлекаемых для работы в российских компаниях;
6) предоставить компаниям гранты на разработку и развитие IT- продуктов;
7) обеспечить ускоренное импортозамещение ПО на объектах критической информационной инфраструктуры;
8) также обеспечить целевое финансирование на создание в России «зеркала» репозитория открытого ПО «GitHub».

❗️Новый брифинг Минобороны РФ по ситуации на Донбассе на вечер 28 февраля:

📍РФ не начинала военные действия на Украине, она их завершает;
📍в военной операции от российских ВС участвуют только офицеры и контрактники;
📍блокирование Мариуполя завершается;
📍населенные пункты, перешедшие под контроль российских ВС, продолжают жить в обычном режиме;
📍планомерное уничтожение жителей Донбасса шло 8 лет - в ходе этой войны погибло более 14 тысяч человек, сотни детей;
📍этому было необходимо положить конец.

❗️ЦБ РФ объявил послабления по кредитам из-за санкций

📍рекомендовал банкам реструктурировать долг, не назначать пени и штрафы, если финансовое положение заемщика ухудшилось из-за санкций;

📍разрешил банкам не увеличивать резервы по кредиту, если финансовое положение заемщика ухудшилось из-за санкций.

